import React, { Component } from 'react'

export default class OrderHistory extends Component {
    constructor() {
        super()
        this.state = {}
    }

    componentDidMount() {
        fetch('/orderhistory')
            .then((res) => { res.json() })
            .then(res => this.setState({ OrderHistory: res }))
    }

    render() {
        console.log(this.state.OrderHistory)
